```cpp
#include <OneWire.h>
#include <DallasTemperature.h>

// Data wire is plugged into GPIO4 on the ESP32
#define ONE_WIRE_BUS 4

OneWire oneWire(ONE_WIRE_BUS);
DallasTemperature sensors(&oneWire);

void setup() {
  Serial.begin(115200);
  sensors.begin();
}

void loop() {
  sensors.requestTemperatures(); // Send the command to get temperatures

  // Loop through each sensor
  for (int i = 0; i < sensors.getDeviceCount(); i++) {
    // Get the address of the sensor
    String address = sensors.getAddress(i);

    // Get the temperature in Celsius
    float temperatureC = sensors.getTempCByIndex(i);

    // Print the address and temperature
    Serial.print("Sensor Address: ");
    Serial.println(address);
    Serial.print("Temperature: ");
    Serial.print(temperatureC);
    Serial.println("°C");
  }

  delay(2000); // Wait 2 seconds before reading again
}
```

**Explanation:**

1. **Include Libraries:**
   - `OneWire.h`: Provides functions for communicating with 1-Wire devices.
   - `DallasTemperature.h`:  Simplifies reading temperatures from Dallas Temperature sensors.

2. **Define Wire Pin:**
   - `#define ONE_WIRE_BUS 4`: Sets GPIO4 as the data pin connected to the 1-Wire bus.

3. **Create Objects:**
   - `OneWire oneWire(ONE_WIRE_BUS);`: Creates an `OneWire` object to handle communication on the specified pin.
   - `DallasTemperature sensors(&oneWire);`: Creates a `DallasTemperature` object, linking it to the `OneWire` object.

4. **Setup:**
   - `Serial.begin(115200);`: Initializes serial communication at 115200 baud rate.
   - `sensors.begin();`: Initializes the Dallas Temperature library.

5. **Loop:**
   - `sensors.requestTemperatures();`: Sends a command to all connected sensors to start measuring temperatures.
   - **Sensor Loop:**
     - `for (int i = 0; i < sensors.getDeviceCount(); i++)`: Iterates through each detected sensor.
     - `String address = sensors.getAddress(i);`: Gets the unique address of the current sensor.
     - `float temperatureC = sensors.getTempCByIndex(i);`: Reads the temperature in Celsius from the current sensor.
     - **Print Data:**
       - Prints the sensor address and temperature to the serial monitor.
   - `delay(2000);`: Waits for 2 seconds before reading temperatures again.



**Remember:**

- Connect your Dallas 18B20 sensors to the ESP32 according to the wiring diagram.
- Make sure you have the necessary libraries installed in your Arduino IDE.
- Adjust the `ONE_WIRE_BUS` constant to match the GPIO pin you're using.

