```c
#include <stdio.h>

void bubbleSort(int arr[], int n) {
  int i, j, temp;
  for (i = 0; i < n - 1; i++) {
    for (j = 0; j < n - i - 1; j++) {
      if (arr[j] > arr[j + 1]) {
        // Swap arr[j] and arr[j+1]
        temp = arr[j];
        arr[j] = arr[j + 1];
        arr[j + 1] = temp;
      }
    }
  }
}

int main() {
  int arr[] = {64, 34, 25, 12, 22, 11, 90};
  int n = sizeof(arr) / sizeof(arr[0]);

  printf("Unsorted array: \n");
  for (int i = 0; i < n; i++) {
    printf("%d ", arr[i]);
  }

  bubbleSort(arr, n);

  printf("\nSorted array: \n");
  for (int i = 0; i < n; i++) {
    printf("%d ", arr[i]);
  }
  printf("\n");

  return 0;
}
```

**Explanation:**

* **`bubbleSort(int arr[], int n)`:** This function takes an integer array `arr` and its size `n` as input.
* **Outer loop (`i`)**: Iterates through the array `n-1` times.
* **Inner loop (`j`)**:  Compares adjacent elements (`arr[j]` and `arr[j+1]`). If they are in the wrong order, it swaps them using a temporary variable `temp`.
* **Swapping**: The `if` condition checks if the current element is greater than the next element. If it is, they are swapped.
* **Sorted Array**: After each pass of the outer loop, the largest element "bubbles" to its correct position at the end of the unsorted part of the array.

**Key Points:**

* **Time Complexity:** O(n^2) in the worst and average cases.
* **Space Complexity:** O(1) - It sorts the array in place.
* **Stable Sort:** Yes, Bubble Sort is a stable sorting algorithm.



