[Final response] 

```javascript
function checkPrimeNumbers(numbers) {
  for (let i = 0; i < numbers.length; i++) {
    if (isPrime(numbers[i])) {
      console.log(numbers[i] + " is a prime number");
    }
  }
}

function isPrime(num) {
  if (num <= 1) return false;
  for (let i = 2; i <= Math.sqrt(num); i++) {
    if (num % i === 0) {
      return false;
    }
  }
  return true;
}

// Example usage:
const numbers = [1, 2, 3, 4, 5];
checkPrimeNumbers(numbers);
```

**Explanation:**

1. **`checkPrimeNumbers(numbers)` function:**
   - Takes an array of numbers as input.
   - Iterates through each number in the array using a `for` loop.
   - For each number, it calls the `isPrime()` function to check if it's prime.
   - If `isPrime()` returns `true`, it prints the number to the console.

2. **`isPrime(num)` function:**
   - Takes a single number as input.
   - Returns `false` if the number is less than or equal to 1 (since 1 is not prime).
   - Iterates from 2 up to the square root of the number.
   - If the number is divisible by any number in this range, it's not prime, so it returns `false`.
   - If the loop completes without finding a divisor, the number is prime, and it returns `true`.

**How it works:**

- A prime number is a whole number greater than 1 that has only two divisors: 1 and itself.
- The `isPrime()` function checks for primality by iterating through potential divisors up to the square root of the number. This is sufficient because if a number has a divisor greater than its square root, it must also have a divisor smaller than its square root.



